The errors you get when using ? in your main function are okay, but they are not great. For example, when you run std::fs::read_to_string("test.txt")? and the file test.txt doesn't exist, you get this output: Error: Os { code: 2, kind: NotFound, message: "No such file or directory" } In cases where your code doesn't actually contain the file name, it would be hard to tell which file was NotFound. There are multiple ways to deal with this. For one, we can create our own error type and use that to build a custom error message: #[derive(Debug)]
struct CustomError(String); fn main() -> Result<(), CustomError> { let path = "test.txt"; let content = std::fs::read_to_string(path) .map_err(|err| CustomError(format!("Error reading `{}`: {}", path, err)))?; println!("file content: {}", content); Ok(())
} Running this, we'll get our custom error message: Error: CustomError("Error reading `test.txt`: No such file or directory (os error 2)") Not very pretty, but we can adapt the debug output for our type later on. This pattern is very common. It has one problem though: We don't store the original error, only its string representation. The popular anyhow library has a neat solution for that: Its Context trait can be used to add a description similar to our CustomError type. Additionally, it keeps the original error, so we get a "chain" of error messages pointing to the root cause. 먼저 Cargo.toml 파일의 [dependencies] 섹션에 anyhow = "1.0"을 추가하여 anyhow 크레이트를 가져옵니다. The full example will look like this: use anyhow::{Context, Result}; fn main() -> Result<()> { let path = "test.txt"; let content = std::fs::read_to_string(path) .with_context(|| format!("could not read file `{}`", path))?; println!("file content: {}", content); Ok(())
