You can pretty much print all the things you like with the println! macro. This macro has some pretty amazing capabilities, but also a special syntax. It expects a string literal that contains placeholders as the first parameter. The string will be filled in by the values of the parameters that follow as further arguments. 예를 들어: let x = 42;
println!("My lucky number is {}.", x); will print: My lucky number is 42. The curly braces ({}) in the string above is one of these placeholders. This is the default placeholder type that tries to print the given value in a human readable way. For numbers and strings, this works very well, but not all types can do that. This is why there is also a "debug representation" that you can get by filling the braces of the placeholder like this: {:?}. 예를 들어: let xs = vec![1, 2, 3];
println!("The list is: {:?}", xs); will print: The list is: [1, 2, 3] If you want your own data types to be printable for debugging and logging, you can typically add a #[derive(Debug)] above their definition. Note: "User-friendly" printing is done using the Display trait and debug output (human-readable but targeted at developers) uses the Debug trait. You can find more information about the syntax you can use in println! in the documentation for the std::fmt module .

