There are two complementary approaches to testing functionality. One is to test the small units that you use to build your complete application. These are called "unit tests". Another is to test the final application from the outside, called black box tests or integration tests. Let's begin with the first one. To figure out what we should test, let's see what our program features are. grrs is supposed to print out the lines that match a given pattern, so let's write unit tests for exactly this . We want to ensure that our most important piece of logic works, and we want to do it in a way that is not dependent on any of the setup code we have around it like the CLI arguments. grrs의 첫 번째 구현 으로 돌아가서 main 함수에 이 코드 블록을 추가했습니다. // ...
for line in content.lines() { if line.contains(&args.pattern) { println!("{}", line); }
} Sadly, this is not very easy to test. First of all, it's in the main function, so we can't easily call it. This is fixed by moving this piece of code into a function: fn find_matches(content: &str, pattern: &str) { for line in content.lines() { if line.contains(pattern) { println!("{}", line); } }
} Now, we can call this function in our test and see what its output is: #[test]
fn find_a_match() { find_matches("lorem ipsum\ndolor sit amet", "lorem"); assert_eq!( // 어... 아니면... 할 수 있을까요? 지금 find_matches는 stdout, 즉 터미널에 직접 인쇄합니다. 테스트에서 이것을 쉽게 캡처할 수 없습니다! 이것은 구현 후에 테스트를 작성할 때 종종 발생하는 문제입니다. 우리는 사용되는 컨텍스트에 확고하게 통합된 함수를 작성했습니다. Note: This is totally fine when writing small CLI applications. There's no need to make everything testable! It is important to think about which parts of your code you might want to write unit tests for. While we'll see that it's straightforward to change this function to be testable, this is not always the case. Alright, how can we make this testable? We'll need to capture the output somehow. Rust's standard library has some neat abstractions for dealing with I/O (input/output), and we'll make use of one called std::io::Write . This is a trait that abstracts over things we can write to, which includes strings and stdout. If this is the first time you've heard "trait" in the context of Rust, you are in for a treat. Traits are one of the most powerful features of Rust. You can think of them like interfaces in Java or type classes in Haskell, whatever you are more familiar with. They allow you to abstract over behavior that can be shared by different types. Code that uses traits can express ideas in very generic and flexible ways. This means it can also get difficult to read. Don't let that intimidate you. Even people who have used Rust for years don't always get what generic code does immediately. In that case, it helps to think of concrete uses. In our case, the behavior that we abstract over is "write to it". Examples for the types that implement (impl) it include the terminal's standard output, files, a buffer in memory, or TCP network connections. Scroll down in the documentation for std::io::Write to see a list of "Implementors". With that knowledge, let's change our function to accept a third parameter. It can be any type that implements Write. This way, we can supply a simple string in our tests and make assertions on it. Here is how we can write this version of find_matches: fn find_matches(content: &str, pattern: &str, mut writer: impl std::io::Write) { for line in content.lines() { if line.contains(pattern) { writeln!(writer, "{}", line); } }
} The new parameter is mut writer, i.e., a mutable thing we call "writer". Its type is impl std::io::Write, which you can read as a placeholder for any type that implements the Write trait. Note how we replaced the println!(…) we used earlier with writeln!(writer, …). println! works the same as writeln!, but it always uses standard output. Now, we can test for the output: #[test]
fn find_a_match() { let mut result = Vec::new(); find_matches("lorem ipsum\ndolor sit amet", "lorem", &mut result); assert_eq!(result, b"lorem ipsum\n");
} To use this in our application code, we have to change the call to find_matches in main by adding &mut std::io::stdout() as the third parameter. Here's an example of a main function that builds on what we've seen in the previous chapters and uses our extracted find_matches function: fn main() -> Result<()> { let args = Cli::parse(); let content = std::fs::read_to_string(&args.path) .with_context(|| format!("could not read file `{}`", args.path.display()))?; find_matches(&content, &args.pattern, &mut std::io::stdout()); Ok(())
} Note: Since stdout expects bytes (not strings), we use std::io::Write instead of std::fmt::Write. As a result, we give an empty vector as writer in our tests (its type will be inferred to Vec<u8>), and in the assert_eq!, we use b"foo". The b prefix makes this a byte string literal , so its type is going to be &[u8] instead of &str. 참고: 이 함수가 String을 반환하도록 만들 수도 있지만 그렇게 하면 동작이 변경됩니다. 터미널에 직접 쓰는 대신 모든 것을 문자열로 수집하고 마지막에 모든 결과를 한 번에 덤프합니다. Exercise for the reader: writeln! returns an io::Result because writing can fail (for example, when the buffer is full and cannot be expanded). Add error handling to find_matches. We've just seen how to make this piece of code testable. We have: Identified one of the core pieces of our application. Put it into its own function. Made it more flexible. 목표는 테스트 가능하게 만드는 것이었지만, 우리가 얻은 결과는 실제로 매우 관용적이고 재사용 가능한 Rust 코드 조각입니다. 정말 멋집니다!

