Thus far, we've gone out of our way to test the business logic of our application, which turned out to be the find_matches function. This is very valuable and is a great first step towards a well-tested code base. Usually, these kinds of tests are called "unit tests". There is a lot of code we aren't testing: Everything that we wrote to deal with the outside world! Imagine you wrote the main function but accidentally left in a hard-coded string instead of using the argument of the user-supplied path. We should write tests for that, too! This level of testing is often called integration testing or system testing. At its core, we are still writing functions and annotating them with #[test]. It's just a matter of what we do inside these functions. For example, we'll want to use the main binary of our project and run it like a regular program. We will put these tests into a new file in a new directory: tests/cli.rs. Note: By convention, cargo will look for integration tests in the tests/ directory. Similarly, it will look for benchmarks in benches/ and examples in examples/. These conventions also extend to your main source code: libraries have a src/lib.rs file, the main binary is src/main.rs, and if there are multiple binaries, cargo expects them to be in src/bin/<name>.rs. Following these conventions will make your code base more discoverable by people used to reading Rust code. grrs is a small tool that searches for a string in a file. We have already tested that we can find a match. Let's think about what other functionality we can test. Here is what I came up with: 파일이 존재하지 않으면 어떻게 됩니까? 일치하는 항목이 없을 때 출력은 무엇입니까? 인수 중 하나(또는 둘 다)를 잊어버리면 프로그램이 오류와 함께 종료됩니까? These are all valid test cases. Additionally, we should include one test case for the happy path: we found at least one match and we print it. To make these kinds of tests easier, we're going to use the assert_cmd crate. It has a bunch of neat helpers that allow us to run our main binary and see how it behaves. We'll also add the predicates crate, which helps us write assertions that assert_cmd can test against and that have great error messages. We won't add those dependencies to the main list, but to a dev dependencies section in our Cargo.toml. They are only required when developing the crate, not when using it. [dev-dependencies]
assert_cmd = "2.0.14"
predicates = "3.1.0" This sounds like a lot of setup. Nevertheless, let's dive right in and create our tests/cli.rs file: use assert_cmd::cargo::*; // Import cargo_bin_cmd! macro and methods
