fn file_doesnt_exist() -> Result<(), Box<dyn std::error::Error>> { let mut cmd = cargo_bin_cmd!("grrs"); cmd.arg("foobar").arg("test/file/doesnt/exist"); cmd.assert() .failure() .stderr(predicate::str::contains("could not read file")); Ok(())
} You can run this test with cargo test, just like the tests we wrote above. It might take a little longer the first time as Command::cargo_bin("grrs") needs to compile your main binary.

