파일의 단어 수를 읽는 프로그램이 있다고 가정해 봅시다. use clap::Parser;
use std::path::PathBuf; /// 파일의 줄 수 계산
#[derive(Parser)]
#[command(arg_required_else_help = true)]
struct Cli { /// 읽을 파일의 경로 file: PathBuf,
} fn main() { let args = Cli::parse(); let mut word_count = 0; let file = args.file; for line in std::fs::read_to_string(&file).unwrap().lines() { word_count += line.split(' ').count(); } println!("Words in {}: {}", file.to_str().unwrap(), word_count)
} 파일 경로를 가져와 줄별로 읽고 공백으로 구분된 단어 수를 계산합니다. 실행하면 파일의 총 단어 수가 출력됩니다. $ cargo run README.md
Words in README.md: 47 하지만 프로그램으로 파이프된 단어 수를 세고 싶다면 어떻게 될까요? Rust 프로그램은 표준 라이브러리의 stdin 함수 를 통해 얻을 수 있는 Stdin 구조체 를 사용하여 stdin을 통해 전달된 데이터를 읽을 수 있습니다. 파일 줄을 읽는 것과 유사하게 stdin에서 줄을 읽을 수 있습니다. stdin을 통해 파이프된 단어를 계산하는 프로그램입니다. use clap::{CommandFactory, Parser};
use std::{ fs::File, io::{stdin, BufRead, BufReader, IsTerminal}, path::PathBuf,
}; /// 파일 또는 stdin의 줄 수 계산
#[derive(Parser)]
#[command(arg_required_else_help = true)]
struct Cli { /// 읽을 파일의 경로, stdin에서 읽으려면 - 사용(tty여서는 안 됨) file: PathBuf,
} fn main() { let args = Cli::parse(); let word_count; let mut file = args.file; if file == PathBuf::from("-") { if stdin().is_terminal() { Cli::command().print_help().unwrap(); ::std::process::exit(2); } file = PathBuf::from("<stdin>"); word_count = words_in_buf_reader(BufReader::new(stdin().lock())); } else { word_count = words_in_buf_reader(BufReader::new(File::open(&file).unwrap())); } println!("Words from {}: {}", file.to_string_lossy(), word_count)
} fn words_in_buf_reader<R: BufRead>(buf_reader: R) -> usize { let mut count = 0; for line in buf_reader.lines() { count += line.unwrap().split(' ').count() } count
} stdin에서 읽으려는 의도를 나타내는 -를 사용하여 텍스트를 파이프한 프로그램으로 실행하면 단어 수가 출력됩니다. $ echo "hi there friend" | cargo run -- -
Words from stdin: 3 런타임에 입력되는 텍스트가 아니라 프로그램으로 파이프되는 입력을 예상하기 때문에 stdin이 대화형이 아니어야 합니다. stdin이 tty인 경우 작동하지 않는 이유를 명확히 하기 위해 도움말 문서를 출력합니다.

