A more convenient way is to use one of the many available libraries. The most popular library for parsing command-line arguments is called clap . It has all the functionality you'd expect, including support for sub-commands, shell completions , and great help messages. 먼저 Cargo.toml 파일의 [dependencies] 섹션에 clap = { version = "4.0", features = ["derive"] }를 추가하여 clap을 가져옵니다. Now, we can write use clap::Parser; in our code and add #[derive(Parser)] right above our struct Cli. Let's also write some documentation comments along the way. 다음과 같이 보일 것입니다(src/main.rs 파일에서 fn main() { 이전). use clap::Parser; /// 파일에서 패턴을 검색하고 해당 패턴을 포함하는 줄을 표시합니다.
#[derive(Parser)]
struct Cli { /// 찾을 패턴 pattern: String, /// 읽을 파일의 경로 path: std::path::PathBuf,
} 참고: 필드에 추가할 수 있는 사용자 지정 속성이 많이 있습니다. 예를 들어 -o 또는 --output 뒤의 인수에 이 필드를 사용하려면 #[arg(short = 'o', long = "output")]를 추가합니다. 자세한 내용은 clap 문서 를 참조하세요. Cli 구조체 바로 아래에 템플릿에 main 함수가 포함되어 있습니다. 프로그램이 시작되면 이 함수를 호출합니다. fn main() { let args = Cli::parse(); println!("pattern: {:?}, path: {:?}", args.pattern, args.path)
} 이렇게 하면 인수를 Cli 구조체로 구문 분석하려고 시도합니다. But what if that fails? That's the beauty of this approach: Clap knows which fields to expect and their expected format. It can automatically generate a nice --help message as well as give some great errors to suggest you pass --output when you wrote --putput. 참고: parse 메서드는 main 함수에서 사용하기 위한 것입니다. 실패하면 오류 또는 도움말 메시지를 인쇄하고 즉시 프로그램을 종료합니다. 다른 곳에서는 사용하지 마세요!
